import Link from 'next/link'

function Header() {
    return <nav>
        <ul>
            <li>
                <Link href="/submit">
                    <a>Submit</a>
                </Link>
            </li>
        </ul>
    </nav>
}
function HomePage() {
    return <>
    <Header />
    <h1>Hello!</h1>
    </>

}

HomePage.getInitialProps = () => {
    return {}
}

export default HomePage
